"use strict";function openGoogleCheckout(n,t){try{WTN||alert("WTN plugin not found");WTN.inAppPurchase({productId:n,productType:t,isConsumable:!0,callback:function(n){var t=n.receiptData;showToast(JSON.stringify(t));showToast(JSON.stringify(n));n.isSuccess}})}catch(i){alert(`error: ${JSON.stringify(i)}`)}}